import React, { Component, Fragment } from 'react'
import { Card, Col, Container, Row, Button } from 'react-bootstrap'
import { Link } from 'react-router-dom'
class RecentProject extends Component {
    constructor(){
        super();
        this.state={
           ProjectData:[]
        }
    }
    componentDidMount(){
            RestClient.GetRequest(AppUrl.ProjectHome).then(result=>{
                this.setState({ProjecteData  :result});
            })
    }
    render() {
        const ProjectList = this.state.ProjectData;
        const ProjectView = ProjectList.map(ProjectList=>{ <Col lg={4} md={6} sm={12}>
            <Card className="projectCard">
                <Card.Img variant="top" src="https://image.freepik.com/free-vector/online-courses-tutorials_52683-37860.jpg" />
                <Card.Body>
                    <Card.Title className="serviceName">Project Name One</Card.Title>
                    <Card.Text className="serviceDescription">
                    Some quick example text to build on the card title and make up the bulk of
                    the card's content.
                    </Card.Text>
                    <Button variant="primary"><Link className="link-style" to="/projectdetails"> View More </Link>  </Button>
                </Card.Body>
            </Card>
        </Col>

            return 
                    
        }) 
        return (
                <Fragment>
                    <Container className="text-center">
                        <h1 className="serviceMainTitle">RECENT PROJECTS</h1>
                        <div className="bottom"></div>
                        <Row>
                            {ProjectView}

                        </Row>
                        
                    </Container>
                </Fragment>
                
            
        )
    }
}

export default RecentProject
